from transformers import Blip2Processor, Blip2ForConditionalGeneration, AddedToken
import torch
from PIL import Image
import io
import base64
import os
import sys
sys.stdout.reconfigure(encoding='utf-8')
os.environ["HF_HUB_DISABLE_SYMLINKS_WARNING"] = "1"
os.environ["HF_HOME"] = "D:/huggingface_cache"
# Função para decodificar a imagem a partir do Base64
def decode_base64_image(base64_string):
    image_data = base64.b64decode(base64_string)
    image = Image.open(io.BytesIO(image_data)).convert("RGB")
    return image

# Função para gerar a descrição da imagem usando o BLIP-2
def generate_image_description(image):
    #device = "cuda" if torch.cuda.is_available() else "cpu"
    device = "cpu"
    torch_dtype = torch.float16 if device == "cuda" else torch.float32
    processor = Blip2Processor.from_pretrained("Salesforce/blip2-opt-2.7b-coco", cache_dir="D:/huggingface_cache")
    model = Blip2ForConditionalGeneration.from_pretrained(
        "Salesforce/blip2-opt-2.7b-coco",
        torch_dtype=torch_dtype,
        cache_dir="D:/huggingface_cache"
    )
    model.to(device)
    #processor.num_query_tokens = model.config.num_query_tokens
    #image_token = AddedToken("<image>", normalized=False, special=True)
    #processor.tokenizer.add_tokens([image_token], special_tokens=True)

    #model.resize_token_embeddings(len(processor.tokenizer), pad_to_multiple_of=64)
    #model.config.image_token_index = len(processor.tokenizer) - 1

    prompt = "Question: Describe in detail all the words in the image. Answer:"

    # Prepare inputs with both image and prompt
    inputs = processor(images=image, text=prompt, return_tensors="pt").to(device)

    # Generate outputs using model.generate()
    outputs = model.generate(**inputs, max_new_tokens=1000,
        num_beams=5,
        do_sample=True,
        temperature=0.7,
        top_p=0.9,
        repetition_penalty=1.1,
        early_stopping=True)

    # Decode the generated tokens to get the description
    #description2 = processor.batch_decode(outputs, skip_special_tokens=True)[0].strip()
    #print(description2)
    description = processor.decode(outputs[0], skip_special_tokens=True).strip()
    print(description)
    return description

# Função para formatar a descrição em Markdown
def format_description_to_markdown(description):
    markdown = f"# Descrição da Imagem\n\n{description}\n"
    return markdown

# Exemplo de uso
if __name__ == "__main__":
    # String Base64 da imagem (exemplo)
    
    base64_string = ""

    # Decodificar a imagem
    image = decode_base64_image(base64_string)

    # Gerar a descrição da imagem
    description = generate_image_description(image)

    # Formatar a descrição em Markdown
    markdown_description = format_description_to_markdown(description)

    # Exibir o Markdown resultante
    print(markdown_description)


